import { StyleSheet, View, Text } from "react-native"

export default function MealsOverviewScreen({ navigation }) {
    return <View style={styles.container}>
            <Text>Meals Overview Screen</Text>
        </View>
}

const styles = StyleSheet.create({
    container: {
        flex:1,
        padding: 16,
    }

})
